import React from 'react'
import classes from './Solutions.module.css'


const Solutions=props=>{

    let grid=new Array(3)
    for(let i=0;i<3;i++)
      grid[i]=new Array(3)


    let idx=0;
    for(let i=0;i<3;i++)
    {
        for(let j=0;j<3;j++)
         {
            grid[i][j]=parseInt(props.string[idx]);
            idx+=2;
         }
    }


    return (
        <div className={classes.gridContainer}>
        {grid.map(g=>{
           return (
               g.map(gc=>{
                   return (
                       <div className={classes.gridItem} style={{backgroundColor:'green'}}/>
                   )
               })
        )}
        )}

        </div>

    )

}

export default Solutions
